import React, { useContext, useState } from "react";
import { AuthContext } from "../context/AuthContext";

// Composant pour l'espace Admin
const AdminSection: React.FC = () => {
  return (
    <div>
      <h2>Espace Admin</h2>
      <p>Ici, l'administrateur peut gérer les utilisateurs et le contenu.</p>
    </div>
  );
};

// Composant pour l'espace Chat
const ChatSection: React.FC = () => {
  return (
    <div>
      <h2>Espace Chat</h2>
      <p>Ici, vous pouvez discuter en temps réel.</p>
    </div>
  );
};

// Composant pour l'espace Messagerie
const MessagingSection: React.FC = () => {
  return (
    <div>
      <h2>Espace Messagerie</h2>
      <p>Ici, vous pouvez consulter et envoyer des messages privés.</p>
    </div>
  );
};

// Composant pour poster un message sur le profil
const PostMessageSection: React.FC = () => {
  const [message, setMessage] = useState("");

  const handlePost = (e: React.FormEvent) => {
    e.preventDefault();
    // Ici, vous pouvez ajouter la logique pour envoyer le message à votre backend ou le sauvegarder dans un state global.
    console.log("Message posté :", message);
    setMessage(""); // Réinitialiser le champ après l'envoi
  };

  return (
    <div>
      <h2>Poster un message</h2>
      <form onSubmit={handlePost}>
        <textarea 
          value={message} 
          onChange={(e) => setMessage(e.target.value)} 
          placeholder="Tapez votre message ici..."
          rows={4}
          cols={50}
        ></textarea>
        <br />
        <button type="submit">Poster</button>
      </form>
    </div>
  );
};

const Profile: React.FC = () => {
  const auth = useContext(AuthContext);
  const [activeTab, setActiveTab] = useState<string>("profile");

  const handleLogout = () => {
    auth?.logout();
  };

  return (
    <div>
      <h1>Tableau de bord</h1>
      <button onClick={handleLogout}>Déconnexion</button>

      {/* Barre de navigation pour passer d'une section à l'autre */}
      <nav style={{ marginTop: "20px", marginBottom: "20px" }}>
        <button onClick={() => setActiveTab("profile")}>Profil</button>
        <button onClick={() => setActiveTab("admin")}>Admin</button>
        <button onClick={() => setActiveTab("chat")}>Chat</button>
        <button onClick={() => setActiveTab("messaging")}>Messagerie</button>
        <button onClick={() => setActiveTab("post")}>Poster un message</button>
      </nav>

      {/* Affichage conditionnel selon la section active */}
      <div>
        {activeTab === "profile" && (
          <div>
            <h2>Bienvenue sur votre profil !</h2>
            <p>Ici, vous pouvez voir vos informations personnelles.</p>
          </div>
        )}
        {activeTab === "admin" && <AdminSection />}
        {activeTab === "chat" && <ChatSection />}
        {activeTab === "messaging" && <MessagingSection />}
        {activeTab === "post" && <PostMessageSection />}
      </div>
    </div>
  );
};

export default Profile;
